import React from 'react'; 
import { StyleSheet, Text, View, ImageBackground } from 'react-native';
import { Table, Row, Rows } from 'react-native-table-component';
import TableExample from './datatable';
import RipenessGraph from './chart';
import VarietyGraph from './chart2';

const data = [
  ['Count', 'Variety            ', 'Ripeness             ', 'Date', 'Time'],
  ['1', 'Sugar Baby', 'Unripe', 'Mar 9, 2024', '03:28'],
  ['2', 'Sugar Baby', 'Unripe', 'Mar 9, 2024', '03:31'],
  ['3', 'Crimson', 'Ripe', 'Mar 9, 2024', '03:37'],
  ['4', 'Crimson', 'Overripe', 'Mar 9, 2024', '03:40'],
  ['5', 'Sugar Baby', 'Ripe', 'Mar 9, 2024', '03:45'],
  ['6', 'Crimson', 'Unripe', 'Mar 9, 2024', '04:13'],
  ['7', 'Crimson', 'Overripe', 'Mar 9, 2024', '04:16'],
  ['8', 'Sugar Baby', 'Ripe', 'Mar 9, 2024', '04:17'],
];

const App = () => {
  return (
    <ImageBackground source={require('./assets/watermelon-seamless-pattern-green-stripes-vector-30741112.jpg')} style={styles.backgroundImage}>
      <View style={styles.container}>
        <View>
          <Text style={styles.title}>Watermelon Ripeness Result</Text>
        </View>
        <View style={styles.graph}>
    <ScrollView style={styles.container1}>
      <Table borderStyle={{ borderWidth: 1, borderColor: '#00b36b' }}>
        <Row
          data={data[0]}
          style={{ height: 50, backgroundColor: '#00ff99' }}
          textStyle={{ margin: 45 }}
        />
        <Rows data={data.slice(1)} textStyle={{ margin: 10 }} />
      </Table>
    </ScrollView>
    </View>
          <View>
              <RipenessGraph/>
              <VarietyGraph/>
            </View>
          </View>
    </ImageBackground>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'transparent',
  },
  container1: {
    flex: 1,
    backgroundColor: '#ccffeb',
    borderColor: '#00b36b',
    borderWidth: 2,
    marginBottom: 100,
  },
  backgroundImage: {
    flex: 1,
    resizeMode: "cover",
    justifyContent: "center"
  },
  title: {
    fontSize: 50,
    fontWeight: "bold",
    color: "white",
    marginBottom: 20,
    marginLeft: 20
  },
  graph: {
    flex: 1,
    marginTop: 50,
    flexDirection: 'row',
    justifyContent: 'space-evenly',
    marginLeft: 10,
  },
  piegraph: {
    flex: 1,
    marginTop: 10,
    flexDirection: 'row',
    justifyContent: 'space-evenly',
  },
});

export default App;
